import Head from 'next/head';
import Navigation from "./navigation"

const Container = (props) => (
    <div>
        <Head>
            <title>NextJs Project</title>
            <link rel="stylesheet" ref="https://stackpath.bootstrapcdn.com/bootswatch/4.5.2/flatly/bootstrap.min.css"/>
        </Head>
        <Navigation/>
        <div>
            {props.children}
        </div>

    </div>

);

export default Container;
